import React from 'react';
import './navbar.css';
import {AppBar, Toolbar, Typography,Tabs} from '@mui/material';
export default function NavBar(){
    return(
        <React.Fragment>
            <AppBar>
                <Toolbar>
                <Tabs sx={{marginLeft:"auto"}} textcolor="inherit">
                    <h2>Home</h2>
                </Tabs>
                </Toolbar>
            </AppBar>
        </React.Fragment>
    );
}
